import React , {useState} from 'react'
import Hero from '../hero/hero'
import About from '../components/about/about'
import { render } from "react-dom";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect
} from "react-router-dom";


import './navbar.scss';

// import {auth} from '../../firbase'

class Navbar extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        linkselected: 0,
        language: 1};
      }

    changelink (type) 
    {
        this.setState({linkselected:type});
    }
    changelanguage (type) 
    {
        this.setState({language:type});
    }

 render(){   
  return (
    <Router>
    <div className="navbar-conrtainer" id="Home">
        <div className="logo">
            <h1>LOGO</h1>
        </div>
        <ul className="pages-list"> 
              <li>
                <Link to="./components/hero/hero">Home</Link>
              </li>
              <li>
                <Link to="./components/about/about'">About</Link>
              </li>

                {/* <li >  <a onClick={()=>this.changelink(0)}
                href="#Home"
                className= {this.state.linkselected == 0  ? "link-active" : ""}
                 >HOME
                 </a></li> 
                <li> <a  onClick={()=>this.changelink(1)}
                href=""
                className= {this.state.linkselected == 1  ? "link-active" : ""} 
                 >ABOUT</a>
                </li>
                <li> <a onClick={()=>this.changelink(2)}
                className= {this.state.linkselected == 2  ? "link-active" : ""}
                >SERVICE
                </a></li> */}
        </ul>
        <ul className="language-select">
            <li> <a onClick={()=>this.changelanguage(0)}
            className = {this.state.language == 0  ? "link-active" : ""}>FR</a> </li>
            <li> <a onClick={()=>this.changelanguage(1)}
            className = {this.state.language == 1  ? "link-active" : ""}>ENG</a> </li>
        </ul>
    </div>
    <Switch>
              <Route exact path="./components/hero/hero'" component={Hero} />
              <Route exact path="./components/about/about'" component={About} />
            </Switch>
    </Router>
  );
}
}


export default Navbar;
